// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC721/IERC721Receiver.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "./interfaces/IERC1155.sol";
import "./interfaces/IBouncePro.sol";
import "./Governable.sol";

contract BounceLotteryNFTPro is Configurable, IERC721Receiver {
    using SafeMath for uint;
    using SafeERC20 for IERC20;

    bytes32 internal constant TxFeeRatio            = bytes32("BLNP::TxFeeRatio");
    bytes32 internal constant MinValueOfBotHolder   = bytes32("BLNP::MinValueOfBotHolder");
    bytes32 internal constant BotToken              = bytes32("BLNP::BotToken");
    bytes32 internal constant AuctionToken          = bytes32("BLNP::AuctionToken");
    bytes32 internal constant UsdtToken             = bytes32("BLNP::UsdtToken");
    bytes32 internal constant BouncePro             = bytes32("BLNP::BouncePro");
    bytes32 internal constant UniswapV2Router02     = bytes32("BLNP::UniswapV2Router02");
    bytes32 internal constant EnableUniSwap         = bytes32("BLNP::EnableUniSwap");
    uint    internal constant TypeErc721            = 0;
    uint    internal constant TypeErc1155           = 1;
    address internal constant DeadAddress           = 0x000000000000000000000000000000000000dEaD;

    struct CreateReq {
        uint projectId;
        // beneficiary of the pool
        address payable beneficiary;
        //NFT token
        address token0;
        //NFT id
        uint tokenId0;
        // total amount of token id of token0
        uint amountTotal0;
        //erc20 or eth
        address token1;
        //erc20 or eth amount
        uint amount1;
        // NFT token type
        uint nftType;
        // max player num
        uint maxPlayer;
        // share num
        uint nShare;
        // the duration in seconds the pool will be closed
        uint duration;
        // the timestamp in seconds the pool will open
        uint openAt;
        // whether or not whitelist is enable
        bool enableWhiteList;
        // whether or not kyc list is enable
        bool enableKycList;
        bool onlyBot;
        uint maxEthPerWallet;
    }

    struct Pool {
        uint projectId;
        // beneficiary of the pool
        address payable beneficiary;
        //NFT token
        address token0;
        //NFT id
        uint tokenId0;
        // total amount of token id of token0
        uint amountTotal0;
        //erc20 or eth
        address token1;
        //erc20 or eth amount
        uint amount1;
        // NFT token type
        uint nftType;
        // max player num
        uint maxPlayer;
        // the timestamp in seconds the pool will open
        uint openAt;
        // the timestamp in seconds the pool will be closed
        uint closeAt;
        // whether or not whitelist is enable
        bool enableWhiteList;
        // whether or not kyc list is enable
        bool enableKycList;
    }

    struct PoolExt {
        // last bet hash
        uint lastHash;
        // share num
        uint nShare;
    }

    Pool[] public pools;

    // pool index => all player => Serial number
    mapping(uint => mapping(address => uint)) public allPlayer;
    // pool index => all player => if claim
    mapping(uint => mapping(address => bool)) public allPlayerClaim;
    //pool index => PoolExt
    mapping(uint => PoolExt) public poolsExt;

    //address => pool index => whether or not played the pool
    mapping(address => mapping(uint => bool)) public myPlay;

    // pool index => current player number
    mapping(uint => uint) public curPlayerP;
    // pool index => the swap pool only allow BOT holder to take part in
    mapping(uint => bool) public onlyBotHolderP;
    // pool index => maximum swap amount of ETH per wallet, if the value is not set, the default value is zero
    mapping(uint => uint) public maxEthPerWalletP;

    // team address => pool index => whether or not team's pool has been claimed
    mapping(address => mapping(uint => bool)) public teamClaimed;
    // user address => pool index => whether or not my pool has been claimed
    mapping(address => mapping(uint => bool)) public myClaimed;

    // pool index => account => whether or not in white list
    mapping(uint => mapping(address => bool)) public whitelistP;
    // creator address => whether or not it's a creator address
    mapping(address => bool) public creator;

    event Created(uint indexed index, address indexed sender, Pool pool);
    event Bet(uint indexed index, address indexed sender);
    event Claimed(uint indexed index, address indexed sender);
    event UserClaimed(uint indexed index, address indexed sender);

    function initialize(address _governor, address[] memory creators_) public {
        require(msg.sender == governor || governor == address(0), "invalid governor");
        governor = _governor;

        for (uint i = 0; i < creators_.length; i++) {
            addCreator(creators_[i]);
        }

        config[TxFeeRatio] = 0.015 ether;
        config[MinValueOfBotHolder] = 0.5 ether;
        config[EnableUniSwap] = 1;

        // creator = [0x14Fe1c6ADb626A8235b079d4ff66C6b0a3a2E68a, 0xDFfF7b40E289C8da3F0C5b163aCDac1b6d8B24Ee, 0xc6a34b2bf59baF984884A0cf4C84eD1541E710d7]

        // mainnet
        config[UniswapV2Router02] = uint(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
        config[BotToken] = uint(0x5bEaBAEBB3146685Dd74176f68a0721F91297D37);
        config[AuctionToken] = uint(0xA9B1Eb5908CfC3cdf91F9B8B3a74108598009096);
        config[UsdtToken] = uint(0xdAC17F958D2ee523a2206206994597C13D831ec7);
        config[BouncePro] = uint(0x6fe40f415448d930166f9110D3bBe2146383bC66);
    }

    function initialize_rinkeby(address _governor, address[] memory creators_) public {
        initialize(_governor, creators_);

        // rinkeby
        config[BotToken] = uint(0xAbF690E2EbC6690c4Fdc303fc3eE0FBFEb1818eD);
        config[AuctionToken] = uint(0x5E26FA0FE067d28aae8aFf2fB85Ac2E693BD9EfA);
        config[UsdtToken] = uint(0x101194a3FF67f83A05B3E15AfA52D45D588614ca);
        config[BouncePro] = uint(0xdC879146c635a9c613DEc849FaE7b383cbDB437D);
    }

    function create(CreateReq memory poolReq, address[] memory whitelist_) public payable
        isCreator(msg.sender)
    {
        uint index = pools.length;
        if (poolReq.maxEthPerWallet != 0) {
            maxEthPerWalletP[index] = poolReq.maxEthPerWallet;
        }
        if (poolReq.onlyBot) {
            onlyBotHolderP[index] = poolReq.onlyBot;
        }

        // transfer tokenId of token0 to this contract
        if (poolReq.nftType == TypeErc721) {
            require(poolReq.nShare == 1, "invalid nShare");
            IERC721(poolReq.token0).safeTransferFrom(poolReq.beneficiary, address(this), poolReq.tokenId0);
        } else {
            IERC1155(poolReq.token0).safeTransferFrom(poolReq.beneficiary, address(this), poolReq.tokenId0, poolReq.amountTotal0, "");
        }

        addWhitelist(index, whitelist_);

        // create pool
        Pool memory pool;
        pool.projectId = poolReq.projectId;
        pool.beneficiary = poolReq.beneficiary;
        pool.token0 = poolReq.token0;
        pool.tokenId0 = poolReq.tokenId0;
        pool.amountTotal0 = poolReq.amountTotal0;
        pool.token1 = poolReq.token1;
        pool.amount1 = poolReq.amount1;
        pool.nftType = poolReq.nftType;
        pool.maxPlayer = poolReq.maxPlayer;
        pool.openAt = poolReq.openAt;
        pool.closeAt = poolReq.openAt.add(poolReq.duration);
        pool.enableWhiteList = poolReq.enableWhiteList;
        pool.enableKycList = poolReq.enableKycList;
        pools.push(pool);

        poolsExt[index].nShare = poolReq.nShare;

        emit Created(index, msg.sender, pool);
    }

    function bet(uint index) external payable
        isPoolExist(index)
        isPoolNotClosed(index)
        checkBotHolder(index)
    {
        Pool memory pool = pools[index];
        require(pool.openAt <= now, "pool not open");
        require(allPlayer[index][msg.sender] == 0, "You have already bet");
        require(curPlayerP[index] < pool.maxPlayer, "Player has reached the upper limit");

        if (pool.enableWhiteList) {
            require(whitelistP[index][msg.sender], "sender not in whitelist");
        }
        if (pool.enableKycList) {
            require(IBouncePro(getBouncePro()).kyclist(msg.sender), "sender not in KYC list");
        }

        if (pool.token1 == address(0)) {
            require(msg.value >= pool.amount1, "The bet amount is too low");
        } else {
            IERC20(pool.token1).safeTransferFrom(msg.sender, address(this), pool.amount1);
        }

        allPlayer[index][msg.sender] = curPlayerP[index] + 1;
        curPlayerP[index] += 1;
        myPlay[msg.sender][index] = true;

        poolsExt[index].lastHash = uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty, blockhash(block.number - 1))));

        emit Bet(index, msg.sender);
    }

    function claim(uint index) external
        isPoolExist(index)
        isPoolClosed(index)
    {
        Pool memory pool = pools[index];
        require(!teamClaimed[pool.beneficiary][index], "claimed");
        teamClaimed[pool.beneficiary][index] = true;

        uint nShare = poolsExt[index].nShare;
        uint hitShare = (curPlayerP[index] > nShare ? nShare : curPlayerP[index]);
        if (pool.token1 == address(0)) {
            pool.beneficiary.transfer(pool.amount1.mul(hitShare));
        } else {
            IERC20(pool.token1).safeTransfer(pool.beneficiary, pool.amount1.mul(hitShare));
        }
        if (nShare > curPlayerP[index]) {
            if (pool.nftType == TypeErc721) {
                IERC721(pool.token0).safeTransferFrom(address(this), pool.beneficiary, pool.tokenId0);
            } else {
                IERC1155(pool.token0).safeTransferFrom(address(this), pool.beneficiary, pool.tokenId0, pool.amountTotal0.div(nShare).mul(nShare.sub(curPlayerP[index])), "");
            }
        }

        emit Claimed(index, msg.sender);
    }

    function playerClaim(uint index) external
        isPoolExist(index)
        isPoolClosed(index)
    {
        Pool memory pool = pools[index];
        require(myPlay[msg.sender][index], "not played");
        require(allPlayer[index][msg.sender] > 0, "You haven't bet yet");
        require(!allPlayerClaim[index][msg.sender], "You have claimed this pool");
        allPlayerClaim[index][msg.sender] = true;

        if (isWinner(index, msg.sender)) {
            if (pool.nftType == TypeErc721) {
                IERC721(pool.token0).safeTransferFrom(address(this), msg.sender, pool.tokenId0);
            } else {
                IERC1155(pool.token0).safeTransferFrom(address(this), msg.sender, pool.tokenId0, pool.amountTotal0.div(poolsExt[index].nShare), "");
            }
        } else {
            if (pool.token1 == address(0)) {
                msg.sender.transfer(pool.amount1);
            }
            else {
                IERC20(pool.token1).safeTransfer(msg.sender, pool.amount1);
            }
        }

        emit UserClaimed(index, msg.sender);
    }

    function getPlayerStatus(uint index, address target) public view returns (uint) {
        require(index <= pools.length, "this pool does not exist");
        Pool memory pool = pools[index];
        if (pool.beneficiary == target) {
            if (teamClaimed[target][index])
                return uint(5);
            return uint(1);
        }
        if (allPlayer[index][target] != 0) {
            if (allPlayerClaim[index][target])
                return uint(6);
            return uint(2);
        }
        return uint(0);
    }

    function onERC721Received(address, address, uint, bytes calldata) external override returns (bytes4) {
        return this.onERC721Received.selector;
    }

    function onERC1155Received(address, address, uint, uint, bytes calldata) external returns(bytes4) {
        return this.onERC1155Received.selector;
    }

    function getPoolCount() external view returns (uint) {
        return pools.length;
    }

    function lo2(uint value) view public returns(uint) {
        require(value < 65536, "too large");
        if (value <= 2)
            return uint(0);
        else if (value==3)
            return uint(2);
        uint x = 0;
        uint s = value;
        while(value > 1) {
            value >>= 1;
            x++;
        }
        if (s>((2<<(x.sub(1)))+(2<<(x.sub(2))))) {
            return (x.mul(2).add(1));
        }
        return (x.mul(2));
    }

    function calcRet(uint index, uint m) public view returns (uint) {
        uint[32] memory p=[uint(3),3,5, 7, 17, 11,7,11,13,23,31,47,61,89,127,191,251,383,509,761,1021,1531,2039,3067,4093,6143,8191,12281,16381,24571,32749,49139];
        uint nSel=lo2(m);
        return (index.mul(p[nSel])) % m;
    }

    function isWinner(uint index, address sender) public view returns (bool) {
        require(pools[index].closeAt <= now, "this pool is not closed");

        if (allPlayer[index][sender] == 0) {
            return false;
        }

        uint nShare = poolsExt[index].nShare;
        uint curPlayer = curPlayerP[index];
        if (curPlayer <= nShare) {
            return true;
        }

        uint index = poolsExt[index].lastHash % curPlayer;
        uint pos = calcRet(allPlayer[index][sender] - 1, curPlayer);

        if (index.add(nShare) % curPlayer > index) {
            if (pos >= index && pos < (index+nShare)) {
                return true;
            }
        } else {
            if (pos >= index && pos < curPlayer) {
                return true;
            }
            if(pos < index.add(nShare) % curPlayer) {
                return true;
            }
        }

        return false;
    }

    function addWhitelist(uint index, address[] memory whitelist_) public
        isCreator(msg.sender)
    {
        for (uint i = 0; i < whitelist_.length; i++) {
            whitelistP[index][whitelist_[i]] = true;
        }
    }

    function removeWhitelist(uint index, address[] memory whitelist_) external
        isCreator(msg.sender)
    {
        for (uint i = 0; i < whitelist_.length; i++) {
            delete whitelistP[index][whitelist_[i]];
        }
    }

    function addCreator(address creator_) public
        isGovernor(msg.sender)
    {
        creator[creator_] = true;
    }

    function getTxFeeRatio() public view returns (uint) {
        return config[TxFeeRatio];
    }

    function getMinValueOfBotHolder() public view returns (uint) {
        return config[MinValueOfBotHolder];
    }

    function getBotToken() public view returns (address) {
        return address(config[BotToken]);
    }

    function getAuctionToken() public view returns (address) {
        return address(config[AuctionToken]);
    }

    function getUsdtToken() public view returns (address) {
        return address(config[UsdtToken]);
    }

    function getBouncePro() public view returns (address) {
        return address(config[BouncePro]);
    }

    function setUniswapV2Router(address router_) external
        isGovernor(msg.sender)
    {
        config[UniswapV2Router02] = uint(router_);
    }

    function swapETH2BotAndBurn(uint txFee) private {
        if (getEnableUniSwap()) {
            uint amountOutMin = 0;
            address[] memory path = getPath();
            address to = DeadAddress;
            uint deadline = now.add(20 minutes);
            IUniswapV2Router02(getUniswapV2Router()).swapExactETHForTokens{value: txFee}(amountOutMin, path, to, deadline);
        }
    }

    function swapToken2BotAndBurn(address token, uint txFee) private {
        if (getEnableUniSwap()) {
            address router = getUniswapV2Router();
            IERC20(token).safeApprove(router, txFee);
            uint amountOutMin = 0;
            address[] memory path = getPath2(token);
            address to = DeadAddress;
            uint deadline = now.add(20 minutes);
            IUniswapV2Router02(router).swapExactTokensForTokens(txFee, amountOutMin, path, to, deadline);
        }
    }

    function getPath() internal view returns (address[] memory) {
        address[] memory path = new address[](2);
        path[0] = IUniswapV2Router02(getUniswapV2Router()).WETH();
        path[1] = getBotToken();

        return path;
    }

    function getPath2(address token) internal view returns (address[] memory) {
        address[] memory path = new address[](3);
        path[0] = token;
        path[1] = IUniswapV2Router02(getUniswapV2Router()).WETH();
        path[2] = getBotToken();

        return path;
    }

    function getEnableUniSwap() public view returns (bool) {
        return config[EnableUniSwap] != 0;
    }

    function getUniswapV2Router() public view returns (address) {
        return address(config[UniswapV2Router02]);
    }

    modifier checkBotHolder(uint index) {
        if (onlyBotHolderP[index]) {
            require(
                IERC20(getBotToken()).balanceOf(msg.sender) >= getMinValueOfBotHolder()
                || IERC20(getAuctionToken()).balanceOf(msg.sender) >= getMinValueOfBotHolder().mul(100),
                "BOT or Auction is not enough"
            );
        }
        _;
    }

    modifier isPoolClosed(uint index) {
        require(pools[index].closeAt <= now, "this pool is not closed");
        _;
    }

    modifier isPoolNotClosed(uint index) {
        require(pools[index].closeAt > now, "this pool is closed");
        _;
    }

    modifier isPoolExist(uint index) {
        require(index < pools.length, "this pool does not exist");
        _;
    }

    modifier isCreator(address target) {
        require(creator[target], "invalid creator");
        _;
    }

    modifier isGovernor(address governor_) {
        require(governor_ == governor, "invalid governor");
        _;
    }
}
